pragma solidity ^0.4.24;

import "../node_modules/zeppelin-solidity/contracts/token/ERC20/StandardToken.sol";
import "../node_modules/zeppelin-solidity/contracts/ownership/Ownable.sol";

contract GambreumTip is StandardToken, Ownable {

	string public name = "GambreumToken";
	string public symbol = "GTIP";
	uint public decimals = 18;

	function tokenPublish(uint value) public onlyOwner {
		if(totalSupply() == 0) {
			totalSupply_ = value;
			balances[msg.sender] = value;
		} else if (totalSupply() > 0) { 
			totalSupply_ += value;
			balances[msg.sender] += value;
		}
	}

}

contract GambreumPlayer is GambreumTip {

	struct PlayerInfo {
		string username;
		uint winrate;
		bool locked;
	}

	event PlayerCreated(string username);

	mapping (address => PlayerInfo) addressToPlayerInfo;
	mapping (address => uint) addressToBalance;

	function createPlayer(string _name) public {
		emit PlayerCreated(_name);
		require(keccak256(_name) != keccak256("username"));
		string memory player_name = addressToPlayerInfo[msg.sender].username; 
		require(bytes(player_name).length == 0);
		addressToPlayerInfo[msg.sender] = PlayerInfo(_name, 0, false);
	}

	function viewPlayerInfo() public view returns (string username, uint winrate, bool locked) {
		//return addressToPlayerInfo[msg.sender];
		PlayerInfo memory player_info = addressToPlayerInfo[msg.sender];
		return (player_info.username, player_info.winrate, player_info.locked);
	}

}

contract GambreumSystem is GambreumPlayer {

	event ValueChecker(uint value);

	function startGame(uint _bettedTips) public returns (string){
		PlayerInfo storage playerInfo = addressToPlayerInfo[msg.sender];
		require(bytes(playerInfo.username).length > 0); // Check if the player is joining other match or not.
		require(playerInfo.locked == false); // Check if the player is joining other match or not.

		require(balanceOf(msg.sender) >= _bettedTips); // Check if the player has enough tips to join a match.

		string memory winner = _determineWinner();

		if(keccak256(winner) == keccak256("dealer")) { // system won.
			// transfer token to dealer contract.
			return "dealer won";
		} else if(keccak256(winner) == keccak256("player")) { // player won.
			// transfer token to player contract.
			return "player won";
		} else { // draw.
			// do something
			return "draw but dealer won";
		}

	}

	function random() private view returns (uint256) {
		return uint256(keccak256(block.timestamp, block.difficulty));
	}

	//function diceRoll() private view returns (uint8 value) {
	function _diceRoll() private view returns (uint value) {
		uint256 randomNum = random();
		uint first  = (randomNum % 10**3) % 6 + 1;
		uint second = (randomNum % 10**6 / 10**3) % 6 + 1;
		uint third  = (randomNum % 10**9 / 10**6) % 6 + 1;

		return first + second*10 + third*100;
	}

	function _determineWinner() private returns (string winnner) {
		uint diceDealerValue = _diceRoll(); // call only once but pick 6 dice values from here.
		uint dicePlayerValue = _diceRoll(); // MUST FIX HERE. THIS VALUE IS SAME AS ABOVE ONE ANYTIME ;<

		if(diceDealerValue > dicePlayerValue) {
			return "dealer";
		} else if(diceDealerValue < dicePlayerValue) {
			return "player";
		} else { // draw but dealer wins.
			return "draw";
		}

	}

}
